import React from "react";
import styled from "styled-components";
import { Breadcrumbs } from "../components/produpageSpecific/product/ctsPageTitle";
import { Container } from "../components/layout/Container";
import ImageOverlap from "../components/pageSpecific/product/ImageOverlap";

const WindowsTemplate = ({
  title,
  detailsTitle,
  detailsChildren,
  imageSrc,
  imageTitle,
  imageChildren,
}) => {
  const links = [
    {
      name: "Design Options",
      href: "/sub/designoptions",
    },
    {
      name: "Energy Efficiency",
      href: "/sub/energyefficiency",
    },
    {
      name: "Find a Dealer",
      href: "/sub/dealerfinder",
    },
  ];

  console.log("test");

  return (
    <Container>
      <Breadcrumbs links={links} title={title} parent="Windows" />
      <ImageOverlap
        detailsTitle={detailsTitle}
        detailsChildren={detailsChildren}
        imageSrc={imageSrc}
        imageTitle={imageTitle}
        imageChildren={imageChildren}
      />
    </Container>
  );
};

export default WindowsTemplate;
